    [],nt"revision_timestamp": "2016-05-25T00:52:59.498285",nt"name": "standard-terminal-automation-replacement-system",nt"isopen":
    true,nt"url": null,nt"notes": "The Standard Terminal Automation Replacement
    System (STARS) is a digital radar data processing and display system for use by
    terminal air traffic controllers. Controllers use STARS to ensure the safe separation
    of military and civilian aircraft throughout the nation''s airspace. STARS is capable
    of tracking up to 1350 airborne aircraft simultaneously within a terminal area.
     The color displays are specially developed for air traffic control and are capable
    of displaying six distinct levels of weather data (identified by different colors)
    simultaneously with air traffic, allowing controllers to direct aircraft around
    bad weather. ",nt"license_title": "Other License Specified",nt"extras":
